import { useEffect } from "react"
import { getUsersData } from "./helpers/getUsersData"
import { apis } from "./Apis/apis"
import { useDispatch } from "react-redux"
import { getUser } from "./Slices/usersSlice"
import { filterUsersData } from "./helpers/filterUsersData"
const dispatch = useDispatch()

export const useApp = () => {
    let data
    useEffect(() => {
        data = getUsersData(apis.users).then((response: any) => dispatch(getUser(filterUsersData(response))))
    }, [])
    return data
}
